import React from "react";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container  h-content">
      <div className="row ">
        <div className="col ">
          <p className="fs-1 text ">Contact Me</p>
        </div>
      </div>
      <div className="row">
        <div className="col bg-primary">
          <p className="fs-3 text">Contact info</p>
          <p className="fs-6 text">Llamame o dejame un Whp</p>
          <i class="bi bi-telephone-plus-fill "></i>
        </div>
        <div className="col bg-success">Ramirez</div>
      </div>
    </div>
  );
};

export default Contact;
